pragma solidity >=0.4.25 <0.6.0;

import "./HomeTransaction.sol";
//Declare an Event


contract Factory {
  HomeTransaction[] contracts;
  constructor(string memory _greeting) public{

  }

  function create(
        string memory _address,
        string memory _zip,
        uint _realtorFee,
        uint _price,
        uint _proptype,
        uint _acco,
        uint _proparea,
        string memory _blockentry,   //email phone city tenor
